import { useLazyQuery } from "@apollo/client";
import { ALL_CHARACTERS } from "../../data/data";
import React from "react";
import { Card } from "antd";

export default function People({ name }) {
  const [getCharacter] = useLazyQuery(ALL_CHARACTERS, {
    variables: { name },
    onCompleted({ allPeople }) {
      console.log(allPeople);
    },
  });
  return (
    <Card
      title={name}
      extra={<a href="#">More</a>}
      style={{ width: 300, position: "absolute" }}
      onClick={() => getCharacter()}
    >
      {allPeople.name}
    </Card>
  );
}
